// import  React from "react";
import React, { CSSProperties } from "react";

import logo from "../../assets/logo.svg";
import "./style.css";
import foto from "../../assets/img/foto.png";
import capa from "../../assets/img/capa.gif";
import Header from "../../components/header/header";
import Footer from "../../components/footer/footer";
// import './scripts.js';

// import React, { CSSProperties } from "react";

function Home_test(): JSX.Element {
  const myStyles: CSSProperties = {
    marginTop: 550,
  };

  return (
    <>
      <Header />
      <body id="page-top">
        <section className="callout">
          <div className="container text-center">
            <div className="row">
              <div className="col-lg-6 mx-auto mb-5">
                <h2>
                  <em>Campus ON Demand</em>
                </h2>
                <a
                  className="btn btn-primary btn-xl"
                  href="https://startbootstrap.com/theme/stylish-portfolio/"
                >
                  Download Now!
                </a>
              </div>
              <div className="col-lg-6 mx-auto mb-5 ">
                <img src={foto} className="img-fluid" alt="Imagem responsiva" />
              </div>
            </div>
          </div>
        </section>
        <Footer />
        <script src="https://code.jquery.com/jquery-3.5.1.min.js"></script>
        <script src="https://cdn.jsdelivr.net/npm/bootstrap@4.6.0/dist/js/bootstrap.bundle.min.js"></script>
        <script src="https://cdnjs.cloudflare.com/ajax/libs/animejs/3.2.1/anime.min.js"></script>
        <script src="scripts.js"></script>
      </body>
    </>
  );
}

export default Home_test;
